from math import gcd
from Crypto.Util.number import *

o11 = pow(o1, e2, n)
o22 = pow(o2, e1, n)

diff = pow(2, e1 * e2, n) * o11 - pow(1, e1 * e2, n) * o22

p = gcd(n, diff)
q = n // p

assert n == p * q

phi = (p - 1) * (q - 1)
d = inverse(65537, phi)

k = (o1 * o2) % n
k_e = pow(k, 65537, n)
k_inv = inverse(k_e, n)
m_e = (ct * k_inv) % n
m = pow(m_e, d, n)


print(long_to_bytes(m))
